    public static int lengthOfLongestSubstring(String s) {

        String temp = "";
        int longestSubStringLength = 0;
        for (int i = 0; i < s.length(); i++) {
            for (int j = i; j < s.length(); j++) {


                if (!temp.contains("" + s.charAt(j))) {
                    temp = temp + s.charAt(j);
                } else {
                    if (temp.length() > longestSubStringLength) {
                        longestSubStringLength = temp.length();
                    }
                    temp = "" + s.charAt(j);
                }
                if (j == s.length() - 1) {
                    if (temp.length() > longestSubStringLength) {
                        longestSubStringLength = temp.length();
                    }
                }
            }

            temp = "";
        }

        return longestSubStringLength;
    }

    //abcabcbb
    public static int lengthOfLongestSubstringMap(String s) {
        int n = s.length(), ans = 0;
        Map<Character, Integer> map = new HashMap<>(); // current index of character
        // try to extend the range [i, j]
        for (int j = 0, i = 0; j < n; j++) {
            if (map.containsKey(s.charAt(j))) {
                i = Math.max(map.get(s.charAt(j)), i);
            }
            ans = Math.max(ans, j - i + 1);
            map.put(s.charAt(j), j + 1);
        }
        return ans;
    }

    //Map -0 (a,1) 1- (b,2) 2- (c,3) 3- (a,4)
    //abcabcbb
    static int longestSubString(String s) {

        Map<Character, Integer> map = new HashMap<>();
        int longest = 0;

        for (int i = 0; i < s.length(); i++) {

            if (map.containsKey(s.charAt(i))) {
                longest = Integer.max(longest, i + 1 - map.get(s.charAt(i)));
                map.put(s.charAt(i), i + 1);
            } else {
                map.put(s.charAt(i), i + 1);
            }
        }
        return longest;
    }

